When you have both the service definition and the implementation in the same file, you can use #[export_impl] on the impl block. This will also use the name of the struct as the default service name. File structure ./src
├── /bin
│ ├── server.rs
│ ├── client.rs
└── lib.rs Suppose that both the service definitions and implementations are placed in src/lib.rs. // src/lib.rs
use toy_rpc::macros::export_impl; pub struct Foo { } #[export_impl] // The default service name will be "Foo"
impl Foo { // use attribute `#[export_method]` to mark which method to "export" #[export_method] async fn exported_method(&self, args: ()) -> Result<String, String> { Ok("exported method".into()) } async fn not_exported_method(&self, args: ()) -> Result<String, String> { Ok("not exported method".into()) }
} You may also define a separate trait in src/lib.rs which is implemented by some struct in the same file. // continuing in src/lib.rs use async_trait::async_trait; #[async_trait]
pub trait Arith { async fn add(&self, args: (i32, i32)) -> Result<i32, String>; async fn subtract(&self, args: (i32, i32)) -> Result<i32, String>;
} pub struct Bar { }
// implement the Arith trait for `Bar { }`and then mark the implementation as "exported" for RPC #[async_trait]
// Place `#[export_impl] ` after `#[async_trait]`
#[export_impl] // The default service name will be "Bar"
impl Arith for Bar { // Only mark `add(...)` as RPC method #[export_method] async fn add(&self, args: (i32, i32)) -> Result<i32, String> { Ok(args.0 + args.1) } // `subtract(...)` will not be accessible from RPC calls async fn subtract(&self, args: (i32, i32)) -> Result<i32, String> { Ok(args.0 - args.1) }
} We will continue to use this example in the Server and Client chapters.

