Now we are back with the example with #[export_trait] and #[export_trait_impl], let's just remind ourselves that we have three separate crates where the service is defined in "example-service" and will be implemented in "example-server" as shown below. We will continue to use the tokio runtime so that we don't need to change our Cargo.toml file, but because we will be implementing the service below, we will need to add async-trait and our service definition crate into our dependencies. [dependencies]
